import './App.css';
import logo from './weather-icons/cloudy.svg';

function App() {
  return (
    <div className="App">
      <div className="appHeader">
        <input type="text" placeholder="london"></input>
        <button>FIND WEATHER</button>
      </div>
      <div className="body">      
        <img src={logo} />
        <h3>overcast clouds</h3>
        <p><span className='strong'>Tempreture</span> 10C to 11C</p>
      <p><span className='strong'>humidity</span> 78% <span className='strong'>pressure</span> 100.48</p>
</div>
    </div>
  );
}

export default App;
